import React from 'react'
import { Card } from 'react-bootstrap'

function Person({ person }) {
  return (
    <Card className="my-3 p-3 rounded">
        <a href={`/person/${person._id}`}>
            <Card.Img src={person.image}/>
        </a>
    </Card>
  )
}

export default Person
